  ctx.font = "18px sans-serif"; //font size types 
  ctx.fillStyle = "lightgrey";
  ctx.fillRect(0, 0, canvas.width, canvas.height);
  var t = 990; //skip  static ones
  var myinterval = null;

  w = 20;
  h = 20;
  
  function draw() {
    posx = 10;
    posy = 20;
    ctx.clearRect(0,0, canvas.width,canvas.height);
    ctx.fillStyle = "black";
    ctx.fillRect(0, 0, canvas.width, canvas.height);

      console.log('done.');
